package leetcode;

import java.util.*;

/**
 * 功能描述:
 * <p/>
 * Given a non-empty string containing an out-of-order English representation of digits 0-9, output the digits in ascending order.
 * <p/>
 * Note:
 * Input contains only lowercase English letters.
 * Input is guaranteed to be valid and can be transformed to its original digits. That means invalid inputs such as "abc" or "zerone" are not permitted.
 * Input length is less than 50,000.
 *
 * @Author ewnit
 * @Date 16/10/29.
 */
public class Reconstruct_Original_Digits_from_English_423 {

    //用map可行但是会TLE
    public String originalDigits(String s) {
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            char ch = s.charAt(i);
            if (map.get(ch) == null) {
                map.put(ch, 1);
            } else {
                map.put(ch, map.get(ch) + 1);
            }
        }
        Map<Integer, Integer> ansmap = new TreeMap<Integer, Integer>();
        String ans = "";
        if (map.containsKey('z')) {
            int count = map.get('z');
            ansmap.put(0, count);
            map.put('e', map.get('e') - count);
            map.put('r', map.get('r') - count);
            map.put('o', map.get('o') - count);
        }


        if (map.containsKey('w')) {
            int count = map.get('w');
            ansmap.put(2, count);
            map.put('t', map.get('t') - count);
            map.put('o', map.get('o') - count);

        }

        if (map.containsKey('x')) {
            int count = map.get('x');
            ansmap.put(6, count);
            map.put('s', map.get('s') - count);
            map.put('i', map.get('i') - count);

        }

        if (map.containsKey('g')) {
            int count = map.get('g');
            ansmap.put(8, count);
            map.put('e', map.get('e') - count);
            map.put('i', map.get('i') - count);
            map.put('h', map.get('i') - count);
            map.put('t', map.get('t') - count);

        }

        if (map.containsKey('t')) {
            int count = map.get('t');
            if(count>0) {
                ansmap.put(3, count);
                map.put('h', map.get('h') - count);
                map.put('r', map.get('r') - count);
                map.put('e', map.get('e') - count * 2);
            }
        }
        if (map.containsKey('r')) {
            int count = map.get('r');
            if(count>0) {
                ansmap.put(4, count);
                map.put('f', map.get('f') - count);
                map.put('o', map.get('o') - count);
                map.put('u', map.get('u') - count);
            }
        }
        if (map.containsKey('f')) {
            int count = map.get('f');
            if(count>0) {
                ansmap.put(5, count);
                map.put('i', map.get('i') - count);
                map.put('v', map.get('v') - count);
                map.put('e', map.get('e') - count);
            }

        }
        if (map.containsKey('o')) {
            int count = map.get('o');
            if(count>0) {
                ansmap.put(1, count);
                map.put('n', map.get('n') - count);
                map.put('e', map.get('e') - count);
            }
        }
        if (map.containsKey('s')) {
            int count = map.get('s');
            if(count>0) {
                ansmap.put(7, count);
                map.put('e', map.get('e') - count * 2);
                map.put('n', map.get('n') - count);
            }
        }
        if (map.containsKey('e')) {
            int count = map.get('e');
            if(count>0) {
                ansmap.put(9, count);
            }
        }

        for (Integer key : ansmap.keySet()) {
            for(int i=0;i<ansmap.get(key);i++) {
                ans+=key;
            }
        }
        return ans;
    }

    public static void main(String[] args) {
        String input="";

        System.out.println(input.length());
        new Reconstruct_Original_Digits_from_English_423().originalDigits(input);
    }
}
